func (m migrationTest0009) RunAssertsAfterMigrationDown(t *testing.T, db *sql.DB) {
	var count int
	groupedTxs := `SELECT count(*) FROM sync.monitored_txs_group`
	row := db.QueryRow(groupedTxs)
	assert.Error(t, row.Scan(&count))
	txs := `SELECT count(*) FROM sync.monitored_txs`
	row = db.QueryRow(txs)
	assert.NoError(t, row.Scan(&count))
	assert.Equal(t, 17, count)
	var ger common.Hash
	txs = `SELECT global_exit_root FROM sync.sync.monitored_txs`
	row = db.QueryRow(txs)
	assert.Error(t, row.Scan(&ger))
	var groupID int
	txs = `SELECT group_id FROM sync.sync.monitored_txs`
	row = db.QueryRow(txs)
	assert.Error(t, row.Scan(&groupID))

}
func TestMigration0009(t *testing.T) {
	runMigrationTest(t, 9, migrationTest0009{})
}
